// Data Source: "Default of Credit Card Client Data Set" from UCI Machine Learning Repository
// Link : https://archive.ics.uci.edu/ml/datasets/default+of+credit+card+clients
// Note: Data is modified to meet learning purpose

// Objective: Predict customer default

// Variable Description
// TARGET:  Customer Default Status (1: Fail to meet obligation, 0: opposite of 1)
// LIMIT_BAL: Amount of given credit (USD)
// MARITAL: Marital status (Single, Married, Other)
// EDUCATION: Education status (GradSch, Univ, HighSch, Other)
// SEX: Gender (Male, Female)
// AGE: Age(year)
// DELAYx: Payment delay of month-x (month). Eg DELAY1=1 payment delay for 1 month for January's billing
// BILLINGx: Amount of bill statement of month-x (USD)
// PAYMENTx: Amount paid of month-x (USD)
